import React from "react";
import { Link } from "react-router-dom";

export default function Mechanics({image, name, shopName, location, rating, price}){

  return(
    <div className="card" style={{width: 18+"rem"}}>
      <img src={image} alt={name}/>
      <div className="card-body">
        <h3 className="card-title">{shopName}</h3>
        <h5 className="card-text">{location}</h5>
        <h5 className="card-text">{name}</h5>
        <div>
          <li>Ave Price: {price}</li> <li>Rating: {rating}</li>
        </div>
        <div>
        <Link to="/more-details" className="btn btn-primary">More Details</Link>
        </div>
      </div>
    </div>
  )
}
